import React from 'react';
import { TextField, Button, Grid } from '@material-ui/core';
import { makeStyles } from '@material-ui/core/styles';
import { Formik } from 'formik';

const useStyles = makeStyles((theme) => ({
	root: {

		'& .MuiTextField-root': {
			margin: theme.spacing(1),

        },
    form:{
        width : "100%", 
    }
	},
}));

export const SignUp = () => {
	const styles = useStyles();
	return (
		<form onSubmit = {()=>alert('selam')}  noValidate autoComplete='off' className = {styles.form}>
			<Grid
				container
				direction='column'
				justify='center'
				alignItems='stretch'
				spacing={3}
			>
				<Grid  item xs={6} >
					<TextField
						error
						id='filled-error-helper-text'
						label='Email'
						helperText='Incorrect entry.'
						variant='filled'
                        fullWidth
					/>
				</Grid>
				<Grid  item xs={6} >
					<TextField
						error
						id='filled-error-helper-text'
						label='Password'
						helperText='Incorrect entry.'
						variant='filled'
                        fullWidth
					/>
				</Grid>
				<Grid  item xs={6} >
					<Button type = "submit" variant='contained' fullWidth>Register </Button>
				</Grid>
				<Grid  item xs={6} >
					<Button variant='contained' fullWidth>Register with Google</Button>
				</Grid>
			</Grid>
		</form>
	);
};
